<!doctype html>
<html lang="ro">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width,initial-scale=1" />
<title>Panoramă cilindrică — Viewer</title>
<style>
  html,body { height:100%; margin:0; background:#111; display:flex; align-items:center; justify-content:center; }
  .viewer {
    width: min(1000px, 98vw);
    height: min(600px, 60vh);
    background: #000;
    overflow:hidden;
    position:relative;
    border-radius:12px;
    box-shadow: 0 10px 30px rgba(0,0,0,0.6);
    touch-action: none; /* prevent default double-finger gestures from interfering */
  }
  .panorama-img {
    position:absolute;
    top:50%;
    left:0;
    transform: translate3d(0,-50%,0);
    height: auto;
    user-select: none;
    -webkit-user-drag: none;
    will-change: transform, width;
  }
  .overlay {
    position:absolute;
    left:0; right:0; top:0;
    height:48px;
    display:flex;
    align-items:center;
    justify-content:center;
    gap:12px;
    pointer-events:none;
  }
  .label {
    background: rgba(0,0,0,0.45);
    color:white;
    font-family:system-ui,-apple-system,Segoe UI,Roboto,"Helvetica Neue",Arial;
    font-size:14px;
    padding:6px 10px;
    border-radius:8px;
    pointer-events:auto;
  }
  .controls {
    position:absolute;
    right:10px;
    bottom:10px;
    display:flex;
    gap:8px;
    pointer-events:auto;
  }
  .btn {
    background: rgba(255,255,255,0.08);
    color:white;
    border:0;
    padding:8px 10px;
    border-radius:8px;
    font-size:13px;
    cursor:pointer;
  }
</style>
</head>

    <div class="overlay">
      <div class="label">Trage orizontal (touch/mouse) pentru a roti — FOV implicit: <span id="fovLabel">100</span>°</div>
    </div>
    <div class="controls">
      <button class="btn" id="fovMinus" title="Micșorează FOV">−</button>
      <button class="btn" id="fovPlus" title="Mărește FOV">+</button>
      <button class="btn" id="resetBtn" title="Resetare">Reset</button>
    </div>
  </div>

<script>
(function() {
  const viewer = document.getElementById('viewer');
  const img = document.getElementById('pano');
  const fovLabel = document.getElementById('fovLabel');
  const fovMinus = document.getElementById('fovMinus');
  const fovPlus = document.getElementById('fovPlus');
  const resetBtn = document.getElementById('resetBtn');

  // initial yaw (deg) and FOV (deg). FOV controls how much of the 360° is visible.
  let yaw = 0;  // 0..360
  let FOV = 100; // visible horizontal degrees in the viewer (user requested 90-120)
  const minFov = 60, maxFov = 140;

  // internal state for dragging
  let dragging = false;
  let lastX = 0;
  let imgWidth = 0; // width of the panorama image in pixels (scaled)
  let startYaw = 0;

  function updateImgSize() {
    // Set the image width so that the viewer's width corresponds to FOV degrees,
    // while the full image width represents 360 degrees.
    const vw = viewer.clientWidth;
    imgWidth = vw * (360 / FOV);
    img.style.width = imgWidth + 'px';
    // vertically center the image: set top so its vertical middle aligns with viewer's center.
    // We keep image's natural height; let browser compute height automatically.
    updateTransform();
  }

  function normalizeYaw(a) {
    a = a % 360;
    if (a < 0) a += 360;
    return a;
  }

  function updateTransform() {
    // compute translateX so that yaw degrees from left correspond to viewer's center
    const tx = - (yaw / 360) * imgWidth;
    img.style.transform = "translate3d(" + tx + "px,-50%,0)";
  }

  // pointer handling (works for mouse & touch)
  function onPointerDown(clientX) {
    dragging = true;
    lastX = clientX;
    startYaw = yaw;
  }
  function onPointerMove(clientX) {
    if (!dragging) return;
    const dx = clientX - lastX;
    // change in yaw proportional to movement relative to imgWidth
    const dYaw = (dx / imgWidth) * 360;
    yaw = normalizeYaw(startYaw - dYaw); // invert direction so drag-right turns right
    updateTransform();
  }
  function onPointerUp() {
    dragging = false;
  }

  // event bindings
  viewer.addEventListener('touchstart', (ev)=> {
    ev.preventDefault();
    onPointerDown(ev.touches[0].clientX);
  }, {passive:false});

  viewer.addEventListener('touchmove', (ev)=> {
    ev.preventDefault();
    onPointerMove(ev.touches[0].clientX);
  }, {passive:false});

  viewer.addEventListener('touchend', (ev)=> {
    ev.preventDefault();
    onPointerUp();
  });

  viewer.addEventListener('mousedown', (ev)=> {
    ev.preventDefault();
    onPointerDown(ev.clientX);
  });

  window.addEventListener('mousemove', (ev)=> {
    onPointerMove(ev.clientX);
  });

  window.addEventListener('mouseup', (ev)=> {
    onPointerUp();
  });

  // allow wheel to slowly rotate
  viewer.addEventListener('wheel', (ev)=> {
    ev.preventDefault();
    const delta = ev.deltaY || ev.deltaX;
    yaw = normalizeYaw(yaw + (delta > 0 ? 2 : -2));
    updateTransform();
  });

  // FOV controls
  function setFov(v) {
    FOV = Math.max(minFov, Math.min(maxFov, v));
    fovLabel.textContent = Math.round(FOV);
    updateImgSize();
  }
  fovMinus.addEventListener('click', ()=> setFov(FOV - 10));
  fovPlus.addEventListener('click', ()=> setFov(FOV + 10));
  resetBtn.addEventListener('click', ()=> {
    yaw = 0; setFov(100); updateTransform();
  });

  // on resize update image size
  window.addEventListener('resize', updateImgSize);

  // initial setup once image loads (to get natural height)
  img.addEventListener('load', ()=> {
    updateImgSize();
    // ensure image non-draggable
    img.ondragstart = () => false;
  });

  // if image cached and load already happened:
  if (img.complete) {
    updateImgSize();
  }

  // expose for debugging from console
  window._pano = { setYaw: v=>{ yaw = normalizeYaw(v); updateTransform(); }, setFov: (v)=> setFov(v) };
})();
</script>
</body>
</html>
